import React from "react";
import { Route, Routes} from 'react-router-dom';
import HeaderNav from "./components/headerNav/HeaderNav";

function App() {
  return (
    <div className="App">

       <Routes>
       <Route path="/delivery"  element={<HeaderNav />}/>
       </Routes>

    </div>
  );
}

export default App;
